	default_home_page -- default_home_page
FROM sys_resource
;
INSERT INTO sys_role_resource(
	sys_role_id,
	sys_resource_id,	
	alias,	
	sort,	
	default_home_page
) SELECT 2001, -- sys_role_id	
	id,	-- sys_resource_id				
	null, -- alias	
	sort, -- sort	
	default_home_page -- default_home_page
FROM sys_resource
WHERE code IN ('WELCOME', '10', '1001', '100101', '100102', '1002', '100201', '40')
	OR 
	code LIKE '50%'
;

