,(8,'A8133CDDFA7E4FDE9A0E005E589EA560','获取会话秘钥',1,'### 基本信息
| 名称 | 描述 |
| ------------ | ------------ |
| 接口URI | /api/user/getAesKey |
| 请求方式 | GET |
| Content-Type | application/json |
| 使用说明 | 每一次会话都会生成一个随机的AES秘钥，用于前后端部分敏感数据交互的加密与解密，增强安全。 |

### 响应结果
```json5
{
